        <div className="col text-center">
          <Link to="/comprar" className="btn btn-primary btn-lg">
            Comprar Producto
          </Link>
        </div>
        {/* Puedes agregar más opciones aquí si es necesario */}
      </div>
    </div>
  );
}

export default Menu;
